attributes.description:
Поговорим на английском? Если вы учите английский язык и хотите "подтянуть" навык общения, то приходите на встречи клуба английского языка English speaking club. 
Клуб организован профессиональными преподавателями для свободного общения за чашечкой кофе или чая.

Есть немного правил:
количество человек — до 20;
уровень знания языка — от В1;
вход — покупка чашки вкусного кофе;

🌱Через Квантовое рисование вы сможете:
* прожить чувства, проработать гнев, страхи и тревожные состояния, преобразовать их в положительные эмоции;
* устранить внутренние конфликты, провоцирующие развитие психосоматических заболеваний;
* развить нестандартный подход к решению проблем в профессиональной, финансовой сфере.
* планировать и формировать события, перемены к лучшему;
* наладить взаимоотношения с близкими, коллегами, друзьями.
